import { AntDesign } from '@expo/vector-icons';
import React from 'react';
import {Text, ScrollView,Image,Button,TouchableOpacity,img,View} from 'react-native';
import { TextInput } from 'react-native-paper';
import logo from './assets/logo_canteen.png';
const YourApp = () => {
  return (
    <ScrollView style={{flex: 1}}>
      <View style={{flex: 1, flexDirection: 'row',alignItems: 'center'}} >
        <img src={logo} style={{width: 110,height:110}}></img>
        <TextInput style={{width: '6%', height: 56,alignItems:'center'}} placeholder='what do u want?'
         right={<TextInput.Icon icon="magnify"/>}></TextInput>
      </View>
    </ScrollView>
  );
};

export default YourApp;
